import React, { Component } from 'react';
import {Button, FormGroup, FormControl, ControlLabel, Grid, Row, Col} from 'react-bootstrap';
import './dashboard.css';
import {Animated} from "react-animated-css";
import Iframe from 'react-iframe';

class Dashboard extends Component {
  constructor(props) {
    super(props);

  }


  render() {
    return (
        <div className="dashboard">

          <div className="menuHeader">
            <div></div>
            <div></div>
            <div>
              <img src={require('./../../resources/images/logout.png')} className="logoutBtn"/>

            </div>
          </div>

          <div className="kibana">
          <Iframe url="https://demo.elastic.co"
            width="100%"
            height="100%"
            id="myId"
            className="kibanaDashboard"
            display="initial"
            position="relative"
            allowFullScreen/>
          </div>
        </div>
    );
  }
}

export default Dashboard;
